local Ease = require "actions/Ease"
local Serial = require "actions/Serial"
local Parallel = require "actions/Parallel"
local Do = require "actions/Do"
local Move = require "actions/Move"
local Action = require "actions/Action"

return function(self)
    local R = self.scene.objectLookup.R2
    if not R:isRemoved() then
        R.movespeed = 3
        R.sprite.visible = true
        self:run(Serial {
            Move(R, self.scene.objectLookup.Waypoint2, "walk"),
            Parallel {
                Ease(R, "x", function() return R.x - 120 end, 5, "linear"),
                Serial {
                    Ease(R, "y", function() return R.y - 50 end, 5, "inout"),
                    Ease(R, "y", function() return R.y + 50 end, 6, "inout")
                },
            },

            Move(R, self.scene.objectLookup.Waypoint3, "walk"),
            Parallel {
                Ease(R, "x", function() return R.x - 120 end, 5, "linear"),
                Serial {
                    Ease(R, "y", function() return R.y - 50 end, 5, "inout"),
                    Ease(R, "y", function() return R.y + 50 end, 6, "inout")
                },
            },

            Move(R, self.scene.objectLookup.Waypoint4, "walk"),
            Ease(R, "y", function() return R.y - 150 end, 5, "inout"),
            Ease(R, "y", function() return R.y - 50 end, 6, "inout"),

            Do(function()
                R:remove()
            end)
        })
    end
    return Action()
end

